pragma solidity 0.8.7;

contract combinestructmappingarray { 

    struct eleve { 
        string nom;
        string prenom;
        uint[] notes;
    }

    mapping(address => eleve) Eleves;

    function addNotes(address _eleve, uint _note) public { 
        Eleves[_eleve].notes.push(_note);
    } 

}

